// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract RegisterFL {
    enum Role { Client, Server }

    struct User {
        address userAddress;
        uint256 registrationTime;
        Role role;
    }

    mapping(address => User) public users;
    address[] public clientAddresses; // Array to store client addresses
    address public serverAddress; // Variable to store the server's address
    uint256 public userCount;

    function register(Role role) public {
        // Determine if the user is new
        bool isNewUser = users[msg.sender].userAddress == address(0);

        // Update user details with the latest registration info
        users[msg.sender] = User({
            userAddress: msg.sender,
            registrationTime: block.timestamp,
            role: role
        });

        // Increment the user count only if it's a new user
        if (isNewUser) {
            userCount++;
        }

        // Store server or client address
        if (role == Role.Server) {
            serverAddress = msg.sender; // Assign the server's address
        } else if (role == Role.Client) {
            clientAddresses.push(msg.sender); // Add client address to the array
        }
    }

    function isRegistered(address user) public view returns (bool) {
        return users[user].userAddress != address(0);
    }

    function getUserRole(address user) public view returns (Role) {
        require(isRegistered(user), "User not registered");
        return users[user].role;
    }

    // Function to get the server address
    function getServerAddress() public view returns (address) {
        require(users[msg.sender].role == Role.Client, "Access denied");
        return serverAddress;
    }

    // Function to get all registered client addresses
    function getClientAddresses() public view returns (address[] memory) {
        require(users[msg.sender].role == Role.Server, "Access denied");
        return clientAddresses;
    }
}

